import React, { useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import '../../styles.css';  // Assurez-vous d'importer les styles
import NavBar from '../NavBar';
import { EmployeeContext } from '../../context/EmployeeContext';  // Importe le contexte

const Ife2 = () => {
    const navigate = useNavigate();
    const { employeeCount } = useContext(EmployeeContext);  // Récupère la valeur du contexte

    const goToInterface3 = () => {
        navigate('/Entreprise/Ife3');  // Navigue vers l'interface 3
    };

    const handleBackClick = () => {
        navigate('/Entreprise/Ife');  // Retourne à l'interface précédente
    };

    return (
      <div className="main-content">
        <div className="header">
          <NavBar />
        </div>

        <div className="info-tooltip-section">
          <div className="go-back-text" onClick={handleBackClick}>
            ❮ Retour
          </div>
        </div>

        <div className="survey-content">
          <h3>Pensez à votre moment le plus occupé pour l'utilisation d'Internet. Combien d'employés diffusent la vidéo en même temps?</h3>
          <p>Nombre d'employés sur Internet : {employeeCount}</p>  {/* Affiche la valeur depuis le contexte */}
          <button className="next-btn" onClick={goToInterface3}>Suivant</button>
        </div>
      </div>
    );
}

export default Ife2;
